function ImageModelConfigs.GetConfig(self, prefabName, imageModelIndex, modelPath)
  local root = ImageModelConfigs[prefabName]
  local temp = nil
  if nil ~= root then
      temp = root[imageModelIndex]
  else
      root = ImageModelConfigs["default"]
  end
  if nil ~= temp then
          temp = temp[modelPath]
  end
  if nil ~= temp then
	    return root, temp
  else
      warn("<ImageModelConfigs>Cannot find "..prefabName..":"..imageModelIndex..":"..modelPath)
      return root, ImageModelConfigs["default"][0]["default"]
  end
end

return ImageModelConfigs